import Huongdandangkytructuyen from "./Huongdandangkytructuyen/Huongdandangkytructuyen";
//* Góp ý
import Gopy from "./Gopy/Gopy";

export {
  Dangnhap,
  Trangchu,
  Dangkytuyensinh,
  FileDinhKem,
  Trangdangky,
  Thongtintuyensinh,
  Danhmucvanban,
  Tracuuketquatuyensinh,
  Ketqua,
  Huongdandangkytructuyen,
  Gopy,
};
